/// Grid = Gérer le display
import { Container, Row, Col, setConfiguration } from 'react-grid-system';
import Widget4 from './Components/Widget4';

class App extends React.Component {
 
  render() {

   

    return (

      <div>
        <Container>
          <Row>
            <Col sm={6}>
              <Widget1 />
            </Col>
            <Col sm={6}>
              <Widget3/>
            </Col>
          </Row>
          <Row>
            <Col sm={3}>
              <Widget4/>
            </Col>
          </Row>
        </Container>

      </div>

    )
  }

}

export default App;
